import React, { Component } from "react";
import styled, { css } from "styled-components";

function Calculator(props) {
  return (
    <>
      <Header>
        <MillionairMakerStackStack>
          <MillionairMakerStack>
            <MillionairMaker>Millionair Maker</MillionairMaker>
            <InitialDeposit placeholder="$0"></InitialDeposit>
            <InitialDeposit1 placeholder="$0"></InitialDeposit1>
          </MillionairMakerStack>
          <Label>Starting Cash</Label>
        </MillionairMakerStackStack>
      </Header>
      <EarlyTitle>Early Life savings phase</EarlyTitle>
      <EarlyLife></EarlyLife>
      <BallerLifeTitle>Baller Life savings phase</BallerLifeTitle>
      <BallerLifeStack>
        <BallerLife></BallerLife>
        <Worth>
          <HowRichAmI>How rich am I?</HowRichAmI>
          <RichLabelRow>
            <RichLabel>Total savings:</RichLabel>
            <RichLabel1>$0</RichLabel1>
          </RichLabelRow>
        </Worth>
      </BallerLifeStack>
    </>
  );
}


const Header = styled.div`
  height: 120px;
  background-color: rgba(0,181,255,1);
  flex-direction: column;
  display: flex;
`;

const MillionairMaker = styled.span`
  font-family: Roboto;
  top: 0px;
  position: absolute;
  font-style: normal;
  font-weight: 700;
  color: rgba(255,255,255,1);
  height: 37px;
  width: 211px;
  font-size: 25px;
  text-align: center;
  left: 0px;
`;

const InitialDeposit = styled.input`
  font-family: Roboto;
  top: 35px;
  left: 141px;
  position: absolute;
  font-style: normal;
  font-weight: 400;
  color: #121212;
  height: 25px;
  width: 87px;
  font-size: 18px;
  border: none;
  background: transparent;
`;

const InitialDeposit1 = styled.input`
  font-family: Roboto;
  top: 35px;
  left: 141px;
  position: absolute;
  font-style: normal;
  font-weight: 400;
  color: #121212;
  height: 25px;
  width: 87px;
  font-size: 18px;
  border: none;
  background: transparent;
`;

const MillionairMakerStack = styled.div`
  top: 0px;
  left: 0px;
  width: 228px;
  height: 60px;
  position: absolute;
`;

const Label = styled.span`
  font-family: Roboto;
  top: 37px;
  left: 0px;
  position: absolute;
  font-style: normal;
  font-weight: 400;
  color: rgba(255,255,255,1);
  height: 28px;
  width: 117px;
  font-size: 18px;
  text-align: center;
`;

const MillionairMakerStackStack = styled.div`
  width: 228px;
  height: 65px;
  margin-top: 45px;
  margin-left: 82px;
  position: relative;
`;

const EarlyTitle = styled.span`
  font-family: Roboto;
  font-style: normal;
  font-weight: 400;
  color: rgba(0,0,0,1);
  font-size: 22px;
  text-align: center;
  margin-top: 12px;
`;

const EarlyLife = styled.div`
  height: 258px;
  background-color: #ff7201;
  margin-top: 10px;
`;

const BallerLifeTitle = styled.span`
  font-family: Roboto;
  font-style: normal;
  font-weight: 400;
  color: rgba(0,0,0,1);
  font-size: 22px;
  text-align: center;
  margin-top: 12px;
`;

const BallerLife = styled.div`
  top: 0px;
  left: 0px;
  height: 151px;
  position: absolute;
  background-color: rgba(255,114,0,1);
  right: 0px;
`;

const Worth = styled.div`
  top: 150px;
  left: 0px;
  height: 133px;
  position: absolute;
  background-color: #02b5ff;
  right: 0px;
  flex-direction: column;
  display: flex;
`;

const HowRichAmI = styled.span`
  font-family: Roboto;
  font-style: normal;
  font-weight: 700;
  color: rgba(255,255,255,1);
  height: 37px;
  width: 211px;
  font-size: 25px;
  text-align: center;
  margin-top: 13px;
  margin-left: 82px;
`;

const RichLabel = styled.span`
  font-family: Roboto;
  font-style: normal;
  font-weight: 400;
  color: rgba(255,255,255,1);
  height: 28px;
  width: 117px;
  font-size: 18px;
  text-align: center;
`;

const RichLabel1 = styled.span`
  font-family: Roboto;
  font-style: normal;
  font-weight: 400;
  color: rgba(255,255,255,1);
  font-size: 20px;
  text-align: center;
  width: 135px;
  height: 25px;
  margin-left: 12px;
`;

const RichLabelRow = styled.div`
  height: 28px;
  flex-direction: row;
  display: flex;
  margin-top: 17px;
  margin-left: 70px;
  margin-right: 41px;
`;

const BallerLifeStack = styled.div`
  height: 283px;
  margin-top: 14px;
  position: relative;
`;

export default Calculator;
